import './directions.module.scss'

function Directions() {
    return (
      <section className="directions">
        <div>
            <div>
                <div className="directions__level">
                    <div className="directions__circle">
                        <b>80</b>
                        <span>level</span>
                    </div>
                </div>
                
            </div>
        </div>
        
      </section>
    );
  }
  
  export default Directions;
